import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import SilogMeals from './FoodMenu/SilogMeals'
import Home from './Home'
import Navbar from './Navbar'
import Snacks from './FoodMenu/Snacks'
import Drinks from './FoodMenu/Drinks'
import Contacts from './Contacts'
import Wings from './FoodMenu/Wings'



function App() {
  return (
    <>
      <BrowserRouter>
        <Navbar />
        {function setActiveLink(setActive){
        var links = document.querySelectorAll("#menuLinks a");
        Array.prototype.map.call(links, function(e) {
            e.className = "";
            if (e.id == setActive)
                e.className = "active";
        })
    }}
        <Switch>
          <Route path="/snacks">
            <Snacks />
          </Route>
          <Route path="/drinks">
            <Drinks />
          </Route>
          <Route path="/silogmeals">
            <SilogMeals />
          </Route>
          <Route path="/wings">
            <Wings />
          </Route>
          <Route path="/contacts">
            <Contacts />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
